import React from 'react';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import DanhSachKhoa from './components/DanhSachKhoa';
import DanhSachLop from './components/DanhSachLop';

function App() {
  return (
    <Router>
      <div className="min-h-screen bg-gray-100 p-4">
        <Routes>
          <Route path="/" element={<DanhSachKhoa />} />
          <Route path="/khoa/:khoaId" element={<DanhSachLop />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
